import React, { useState, useEffect } from 'react';
import styled from 'styled-components';
import Navbar from '../components/Navbar';
import FilterBar from '../components/FilterBar';
import NextBusCard from '../components/NextBusCard';

const HomeContainer = styled.div`
  background-color: #f5f5f5;
  min-height: 100vh;
  padding: 2rem;
`;

const ContentWrapper = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  display: grid;
  grid-template-columns: 1fr 300px;
  gap: 2rem;

  @media (max-width: 768px) {
    grid-template-columns: 1fr;
  }
`;

const MainContent = styled.div`
  display: flex;
  flex-direction: column;
  gap: 2rem;
`;

const Title = styled.h1`
  color: #002B5C;
  text-align: center;
  font-family: 'Inter', sans-serif;
  font-size: 2.5rem;
  margin-bottom: 1rem;
`;

const WeatherCard = styled.div`
  background: white;
  border-radius: 12px;
  padding: 1.5rem;
  box-shadow: 0 2px 8px rgba(0, 0, 0, 0.1);
  height: fit-content;
`;

const WeatherHeader = styled.div`
  display: flex;
  align-items: center;
  justify-content: space-between;
  margin-bottom: 1rem;
`;

const WeatherTitle = styled.h2`
  color: #002B5C;
  font-size: 1.2rem;
  margin: 0;
`;

const WeatherInfo = styled.div`
  display: flex;
  flex-direction: column;
  gap: 0.5rem;
`;

const WeatherDetail = styled.div`
  display: flex;
  justify-content: space-between;
  color: #666;
  font-size: 0.9rem;
`;

const WeatherValue = styled.span`
  color: #002B5C;
  font-weight: 500;
`;

const Temperature = styled.div`
  font-size: 2.5rem;
  color: #002B5C;
  font-weight: 600;
  text-align: center;
  margin: 1rem 0;
`;

const WeatherIcon = styled.div`
  font-size: 2rem;
  text-align: center;
  margin: 1rem 0;
`;

const LoadingSpinner = styled.div`
  text-align: center;
  color: #666;
  padding: 2rem;
`;

const ErrorMessage = styled.div`
  text-align: center;
  color: #dc3545;
  padding: 2rem;
  background: #fff5f5;
  border-radius: 8px;
  margin: 1rem 0;
`;

const Home = () => {
  const [weather, setWeather] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchWeather = async () => {
      try {
        setLoading(true);
        setError(null);
        // Replace with your actual weather API key and endpoint
        const response = await fetch(
          `https://api.openweathermap.org/data/2.5/weather?q=Oswego,NY,US&units=imperial&appid=YOUR_API_KEY`
        );

        if (!response.ok) {
          throw new Error('Weather data not available');
        }

        const data = await response.json();
        setWeather(data);
      } catch (error) {
        console.error('Error fetching weather:', error);
        setError('Unable to load weather data. Please try again later.');
      } finally {
        setLoading(false);
      }
    };

    fetchWeather();
  }, []);

  const renderWeatherContent = () => {
    if (loading) {
      return <LoadingSpinner>Loading weather data...</LoadingSpinner>;
    }

    if (error) {
      return <ErrorMessage>{error}</ErrorMessage>;
    }

    if (!weather || !weather.main) {
      return <ErrorMessage>Weather data not available</ErrorMessage>;
    }

    return (
      <>
        <WeatherIcon>
          {weather.weather?.[0]?.main === 'Clear' ? '‚òÄÔ∏è' : 
           weather.weather?.[0]?.main === 'Clouds' ? '‚òÅÔ∏è' : 
           weather.weather?.[0]?.main === 'Rain' ? 'üåßÔ∏è' : 
           weather.weather?.[0]?.main === 'Snow' ? 'üå®Ô∏è' : 'üå§Ô∏è'}
        </WeatherIcon>
        <Temperature>
          {Math.round(weather.main.temp)}¬∞F
        </Temperature>
        <WeatherInfo>
          <WeatherDetail>
            <span>Feels Like</span>
            <WeatherValue>{Math.round(weather.main.feels_like)}¬∞F</WeatherValue>
          </WeatherDetail>
          <WeatherDetail>
            <span>Humidity</span>
            <WeatherValue>{weather.main.humidity}%</WeatherValue>
          </WeatherDetail>
          <WeatherDetail>
            <span>Wind</span>
            <WeatherValue>{Math.round(weather.wind.speed)} mph</WeatherValue>
          </WeatherDetail>
        </WeatherInfo>
      </>
    );
  };

  return (
    <HomeContainer>
      <Navbar />
      <ContentWrapper>
        <MainContent>
          <Title>CENTRO BUS PREDICTOR</Title>
          <FilterBar />
          <NextBusCard route="" direction="" stop="" nextArrival="" />
        </MainContent>

        <WeatherCard>
          <WeatherHeader>
            <WeatherTitle>Oswego, NY Weather</WeatherTitle>
          </WeatherHeader>
          {renderWeatherContent()}
        </WeatherCard>
      </ContentWrapper>
    </HomeContainer>
  );
};

export default Home;
